	(1, 'Youth Leadership Forum 5 - Participations', 'YLF05PAR', 'Had participated effectively in the preparing and organizing of the th Youth leadership forum (YLF)  sponsered by  the International Academy for Leadership and Development(IALD)\r\nwhich was held at istanbul sheir University\r\nentitled \r\nMove locally ... Think globally', 'Youth Leadership Forum', 'YLF05PAR.png', 'YLF05PAR.png', 'YLF05PAR.png', 1, '2019-09-02 21:55:33', 375, 531, 360, 240, 420, 200, 550),
